script: |
  super -f text -I q932.spq | sort > q932.out

inputs:
  - name: q932.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + - col2 * - col1 + - col2 * - col2 + - + 17 - col1 + + col2 - - ( - col1 ) / - 71 * col1 BETWEEN col2 * col2 AND col0 + - col0 * + col1;
  - name: tab1

outputs:
  - name: q932.out
    data: |
      51	14	96
      85	5	59
      91	47	68
